import React from "react";
import { useState } from "react";
import "./popup.css";

function POPUP({ elementsMap,state,...otherProps }) {
  const [enabled, setEnabled] = useState(state);

  const {key, values}=elementsMap;

  const handleEventClick = () => {
    setEnabled(false);
  };
  return (
    <div className={enabled ? "popup" : "hide"} {...otherProps}>
      <div className="title">{key}</div>
      <div className="description">
        <ul>
          {values?values.map((element) => {
            return <li className="list">{element}</li>;
          }):""}
        </ul>
      </div>
      <div className="dismiss-btn">
        <button className="dismiss-popup-btn" onClick={handleEventClick}>
          Dismiss
        </button>
      </div>
    </div>
  );
}

export default POPUP;
